 mothers and human beings. Can the bond between mother and child survive the harsh realities of life behind bars?"},"lengthSeconds":"2729","ownerProfileUrl":"http://www.youtube.com/user/irate87","externalChannelId":"UCWQVkb20Cf51A8Qvopjnssg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"8544994","category":"People \u0026 Blogs","publishDate":"2014-11-15","ownerChannelName":"Swollen Bellies","uploadDate":"2014-11-15"}},"trackingParams":"CAAQu2kiEwiG-p3nx5vqAhWUFfEFHf7eAbc=","attestation":{"playerAttestationRenderer":{"challenge":"a=5\u0026a2=1\u0026b=GVcH8fgeWXHDXMRUb1bwZ-vtGP4\u0026c=1593039825\u0026d=1\u0026e=nErmW89_hr0\u0026c3a=26\u0026c1a=1\u0026c6a=1\u0026hh=4bEmDHt3TpiGaQGKnTBVbChzKznk8gv
